from datetime import datetime
import logging

class UserTestingSummary:
    def __init__(self, ui_sme):
        self.ui_sme = ui_sme
        self.user_testing_results = {}

    def add_user_testing_result(self, result):
        self.user_testing_results[len(self.user_testing_results) + 1] = result

    def generate_summary(self):
        summary = "User Testing Summary:\n"
        for key, value in self.user_testing_results.items():
            summary += f"Test {key}: {value}\n"
        return summary


